DROP TABLE IF EXISTS `business_process`;
CREATE TABLE `business_process` (
  `tenant_id` int(11) NOT NULL COMMENT '业务类型Id',
  `data_id` varchar(128) DEFAULT NULL COMMENT '业务数据Id',
  `user_id` bigint(20) NOT NULL COMMENT '用户Id',
  `start_time` datetime DEFAULT NULL COMMENT '创建时间',
  `end_time` datetime DEFAULT NULL,
  `state_info` varchar(1024) DEFAULT NULL COMMENT '流程状态信息',
  `proc_inst_id` varchar(128) DEFAULT NULL COMMENT '流程实例ID',
  `status` varchar(50) DEFAULT NULL COMMENT '流程状态（开始、结束）'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='业务与流程关联信息表'
/*!50100 PARTITION BY RANGE (tenant_id)
SUBPARTITION BY HASH (user_id % 10)
SUBPARTITIONS 10
(PARTITION p0 VALUES LESS THAN (1) ENGINE = InnoDB,
 PARTITION p1 VALUES LESS THAN (2) ENGINE = InnoDB,
 PARTITION p2 VALUES LESS THAN (3) ENGINE = InnoDB,
 PARTITION p3 VALUES LESS THAN (4) ENGINE = InnoDB,
 PARTITION p4 VALUES LESS THAN MAXVALUE ENGINE = InnoDB) */;

